import React from 'react';

import './Button.scss';

interface Props {
    buttonText: string;
    buttonType: string;
}

const Button = (props: Props) => {
    return (
        <div className={`button ${props.buttonType}`}>{props.buttonText}</div>
    );
}

export default Button;
